import SideNav from "./sidenav";

const Index = () => {
  return (
    <div className="h-screen w-full flex">
     <SideNav />
     <div className=" flex flex-1 mx">
         <h1 className= " text-black font-semibold text-3xl">Dashboard</h1>
     </div>
    </div>
  );
};

export default Index;
